  false,\n\t\"url\": null,\n\t\"notes\": \"This Digital Elevation Model (DEM) dataset,
  published at Not Applicable scale, was produced all or in part from Field Observation
  information as of 2012. It is described as 'Our DEM was created by using the LiDAR
  data from our recent acquisition. The layer was created with the help of contour
  data, mass points & breaklines.'. Data by this publisher are often provided in Custom
  County Coordinate System coordinate system; in a Lambert Conformal-conic projection;
  The extent of these data is generally Chippewa County, WI,Cadott, WI,Chippewa Falls,
  WI,Boyd, WI,Bloomer, WI,Cornell, WI,Eau Claire, WI,Lake Hallie, WI,New Auburn, WI,Stanley,
  WI. The approximate post spacing interval used in the production of this layer is
  Less than 1 meter. It will support a 1 foot contour interval. These data include
  don't break lines Control monumentation used to create these data are available.
  This metadata was auto-generated through the Ramona GIS Inventory System (www.gisinventory.net)
